<?php

namespace Tests\Feature;

use Database\Seeders\DatabaseSeeder;
use Tests\TestCase;

class CardTest extends TestCase
{
    /**
     * A basic feature test example.
     */
    public function test_registration_card(): void
    {
        $response = $this->post('/register/card/000012qwe');

        $response->assertJson([
            "status" => true,
        ]);

        $response->assertStatus(200);
    }

    public function test_accessing_card_success(): void
    {
        $this->seed([DatabaseSeeder::class]);
        $response = $this->post('/login/card', [
            'card_id' => '000012qwe',
            'image' => 'data:image/png;base64,',
        ]);

        $response->assertJson([
            "status" => true,
        ]);

        $response->assertStatus(200);
    }

    // the field card_id and image is requires
    public function test_accessing_card_failed_required(): void
    {
        $response = $this->post('/login/card', [
            'card_id' => null,
            'image' => null
        ]);

        $response->assertJson([
            "status" => false,
        ]);

        $response->assertStatus(404);
    }
    public function test_accessing_card_failed_user_not_found(): void
    {
        $response = $this->post('/login/card', [
            'card_id' => '22222222', // unregistered card id
            'image' => 'data:image/png;base64,',
        ]);

        $response->assertJson([
            "status" => false,
        ]);

        $response->assertStatus(404);
    }

    public function test_accessing_by_pin_success(): void
    {
        $this->seed([DatabaseSeeder::class]);
        $response = $this->post('/login/pin', [
            'pin_number' => '090906',
            'image' => 'data:image/png;base64,',
        ]);

        $response->assertJson([
            'status' => true,
        ]);
        
        $response->assertStatus(200);
    }

    public function test_accessing_by_pin_failed(): void
    {
        $response = $this->post('/login/pin', [
            'pin_number' => '090909',
            'image' => 'data:image/png;base64,',
        ]);

        $response->assertJson([
            'status' => false,
        ]);

        $response->assertStatus(404);
    }
}
